import { useEffect } from "react";
import "./App.css";

function App() {
  useEffect(() => {
    var date = new Date();
    var Date = date.getUTCDate();
    var Month =
      (date.getMonth() + 1).toString().length <= 1
        ? "0" + (date.getMonth() + 1).toString()
        : (date.getMonth() + 1).toString();
    var Year = date.getUTCFullYear();
    const todayDate = ``;
    // news url api
    const newsUrl = `https://newsapi.org/v2/everything?q=apple&from=2022-08-23&to=2022-08-23&sortBy=popularity&apiKey=23d3184ba1324c3f92d3c4c4ddafdd5f`;

    // fetch data from URl
    fetch(newsUrl)
      .then((response) => response.json())
      .then((data) => console.log(data));
  }, []);

  return <div></div>;
}

export default App;
